import React from "react";


const App = () => {
  return (
    <>
      <header>
        <img src="https://coderslab.pl/img/coderslab-logo.png" className="logoImage" alt="logo"/>
      </header>
      <section className="intro">
        <p>
          Scrum Lab React
        </p>
      </section>
    </>
  );
};

export default App;
